import React, { lazy, Suspense } from 'react';
import { Table, Divider , Tag } from 'antd';
import { connect } from 'react-redux';

const { Column, ColumnGroup } = Table;

const data = [
    {
      key: '1',
      firstName: 'Jim',
      lastName: 'Green',
      last1Name: 'Brown',
      last2Name: 'Brown',
      last3Name: 'Brown',
      team:'团队1',
      time:'2020-10-10 10:00',
      ada:'项目1',
      line:123123,
      tags: ['loser'],
    },
    {
      key: '2',
      firstName: 'Jim',
      lastName: 'Green',
      last1Name: 'Brown',
      last2Name: 'Brown',
      last3Name: 'Brown',
      team:'团队1',
      time:'2020-10-10 10:00',
      ada:'项目1',
      line:123123,
      tags: ['loser'],
    },
    {
      key: '3',
      firstName: 'Jim',
      lastName: 'Green',
      last1Name: 'Brown',
      last2Name: 'Brown',
      last3Name: 'Brown',
      team:'团队1',
      time:'2020-10-10 10:00',
      ada:'项目1',
      line:123123,
      tags: ['loser'],
    },
];

const TableDtb = (props) => {
  return (
    <Table dataSource={data}>
    <Column title="序号" dataIndex="key" key="key" />
    <Column title="团队名称" dataIndex="team" key="team" />
    <Column title="项目名称" dataIndex="ada" key="ada" />
    <Column title="扫描时间" dataIndex="time" key="time" />
    <Column title="代码行" dataIndex="line" key="line" />
    <Column
      title="Tags"
      dataIndex="tags"
      key="tags"
      render={tags => (
        <span>
          {tags.map(tag => (
            <Tag key={tag}>
              {tag}
            </Tag>
          ))}
        </span>
      )}
    />
    <Column
      title="Action"
      key="action"
      render={(text, record) => (
        <span>
          <a>Invite {record.lastName}</a>
          <Divider type="vertical" />
          <a>Delete</a>
        </span>
      )}
    />
    <ColumnGroup title="高风险">
      <Column title="新增" dataIndex="firstName" key="firstName" />
      <Column title="高发" dataIndex="lastName" key="lastName" />
      <Column title="修复" dataIndex="last1Name" key="last1Name" />
    </ColumnGroup>
  </Table>
  );
};

const mapStateToProps = (state) => {
  return {}
};

export default connect(mapStateToProps)(TableDtb);
